    async getidname(args) {
      try {
        const response = await Scratch.fetch(
          "https://api.codetabs.com/v1/proxy/?quest=3af050dd&url=https://api.steampowered.com/ISteamApps/GetAppList/v2/"
        );
        if (!response.ok) {
          return "";
        }

        const json = await response.json();
        const jsonobj = json["applist"]["apps"];
        //console.log(jsonobj);
        for (var key in jsonobj) {
          // console.info(jsonobj[key])
          if (jsonobj[key]["name"] === Scratch.Cast.toString(args.NAME)) {
            return jsonobj[key]["appid"];
          }
        }
        return false;
      } catch (error) {
        console.error(error.message);
        return false;
      }
    }
